INCLUDE_TAG_ID = False
DEFAULT_POSSIBILITY = 0.1
DEFAULT_FILENAME = "predictions.csv"


def parse_lables(frame_idx, label_str):
	# print("parse_lables: %s" % label_str)
	pairs = []
	for (idx, value) in enumerate(label_str.split(" ")):
		if idx % 2 == 0:
			pair = []
			tag = vdict[int(value)][0]
			wiki = vdict[int(value)][4]
			if INCLUDE_TAG_ID:
				pair.append(int(value))
			pair.append(tag)
		else:
			pair.append(float(value))
			pairs.append(pair)

	pairs = list(filter(lambda x: x[1] > min_tag_possibility, pairs))
	return pairs

def translate(filename):
	tags = []
	with open(filename, 'rb') as csvfile:
		reader = csv.reader(csvfile)
		idx = 0
		for row in reader:
			if idx == 0:
				idx += 1
				continue

			vid = row[0]
			label_str = row[1]
			frame_idx = idx - 1
			pairs = parse_lables(frame_idx, label_str)
			pairs_str = ' | '.join([str(x) for x in pairs])
			tags.append([frame_idx, pairs_str])
			idx += 1
	
	# outfile
	basename = os.path.basename(filename)
	matches = re.search(r"(.*)_predictions.csv", basename)
	outfname = "%s_tags.txt" % (matches.group(1))
	print(outfname)

	f = open(outfname, 'w')
	for tag_row in tags:
		frame_idx = tag_row[0]
		pairs_str = tag_row[1]
		line = "%d, %s" % (frame_idx, pairs_str)
		f.write(line)
		f.write('\n')
		print(line)
	f.close()

